const cors = require('cors');
const mongoose = require('mongoose');
const api = require('./routes/api');

const app = express();

app.use(bodyParser.json());
app.use(cors());

mongoose.connect('mongodb://localhost/my-app', { useNewUrlParser: true, useUnifiedTopology: true });

